description:
Eight strangers find themselves waking up in a strange cube-shaped room with no recollection of how they came to be there. Soon discovering that they're in a strange fourth dimension where our laws of physics don't apply, they have to unravel the secrets of the &quot;hypercube&quot; in order to survive...



Cast

Kari Matchett ... Kate Filmore
Geraint Wyn Davies ... Simon Grady
Grace Lynn Kung ... Sasha
Matthew Ferguson ... Max Reisler
Neil Crone ... Jerry Whitehall
Barbara Gordon ... Mrs. Paley
Lindsey Connell ... Julia
Greer Kent ... Becky Young
Bruce Gray ... Colonel Thomas H. Maguire
Philip Akin ... The General
Paul Robbins ... Tracton
Andrew Scorer ... Dr. Phil Rosenzweig


